/**
 * @param {string} word
 * @param {number} k
 * @return {number}
 */
var countCompleteSubstrings = function(word, k) {
    let count = 0;
    for (let start = 0; start < word.length; ++start) {
        let freq = new Array(26).fill(0);
        for (let end = start; end < word.length; ++end) {
            freq[word.charCodeAt(end) - 'a'.charCodeAt(0)]++;
            if (freq.every(f => f === 0 || f === k)) {
                if (isValidSubstring(freq, k)) count++;
            }
        }
    }
    return count;

    function isValidSubstring(freq, k) {
        let chars = [];
        for (let i = 0; i < 26; ++i) {
            if (freq[i] === k) chars.push(i);
        }
        for (let i = 1; i < chars.length; ++i) {
            if (chars[i] - chars[i - 1] > 2) return false;
        }
        return true;
    }
};
